import "../components/MovieSlider.css"
import data from "../data"

const MovieSlider = () => {
    const movies = data.map((oneMovie) => {
        const {id, image} = oneMovie
        return <div className="one-movie" key={{id}}>
            <img src={image} alt="" />
        </div>
    })

    return (
        <h1>Ahoj</h1>
    )
}

export default MovieSlider
